import React from 'react';

class Footer extends React.Component {
  render() {
    return (
      <footer className="potter__footer">
        <div className="footer__contact--container">
          <p className="footer__name">Ana JD</p>
          <div className="footer__icons">
            <a href="https://www.linkedin.com/in/ana-jaime-diaz/">
              <i className="fab fa-linkedin-in" />
            </a>
            <a href="https://github.com/anajd">
              <i className="fab fa-github" />
            </a>
            <a href="https://twitter.com/AnaJayD">
              <i className="fab fa-twitter" />
            </a>
          </div>
        </div>
        <div className="footer__date">&copy; 2019</div>
      </footer>
    );
  }
}

export default Footer;
